import React, { useState, useEffect} from 'react';


function Timer (props){


  var timerStyle = {
  fontSize: "2em",
  color: "red" // 'ms' is the only lowercase vendor prefix
};

  return (
    <div>
      <div style={timerStyle}> {props.currentTime}s </div>
    </div>
  )
}

export default Timer;
